import React from "react";
import "./App.css";
import { BigCard } from "./Components/BigCard/BigCard";
import { PageSection} from "./Components/PageSection/PageSection";
import { SmallCard } from "./Components/SmallCard/SmallCard";

const quemSou = {
  imagem: require("./imagens/samuel.jpg"),  
  titulo: "Samuel Quaresma Oliveira",
  texto: "Meu texto explicativo"
}

const emailContato = {
  icone: "http://pluspng.com/img-png/email-icon-png-download-icons-logos-emojis-email-icons-2400.png",
  email: "squoliver@gmail.com"
}

const tipoSessao = {
  tipo: "dadosPessoais"
}

function App() {
  return (
    <div className="App">
      <PageSection nomeSessao={tipoSessao.tipo}>
        <h1>Dados Pessoais</h1>
        <BigCard imagem={quemSou.imagem} titulo={quemSou.titulo} texto={quemSou.texto} />
        <SmallCard imagem={emailContato.icone} titulo="e-mail: " email={" " + emailContato.email} />
      </PageSection>
    </div>
  );
}

export default App;
